  <style>
    body {

      background: #111;
      color: #eee;
      padding: 20px;
    }

    #search {
      margin-bottom: 15px;
      padding: 10px;
      width: 100%;
      max-width: 400px;
      font-size: 16px;
      border-radius: 5px;
      border: none;
    }

    #buttons {
      display: grid;
      grid-template-columns: repeat(5, 1fr);
      gap: 10px;
    }

    button {
      background: #007acc;
      color: white;
      border: none;
      padding: 20px;
      height: 80px;
      border-radius: 5px;
      cursor: pointer;
      font-weight: bold;
      font-size: 14px;
      transition: background-color 0.2s;
      overflow: hidden;
      text-overflow: ellipsis;
      white-space: nowrap;
    }

    button:hover {
      background: #005fa3;
    }

    #status {
      margin-bottom: 15px;
    }
  </style>
</head>

  const searchInput = document.getElementById('search');
  const buttonsDiv = document.getElementById('buttons');
  const statusDiv = document.getElementById('status');

  function parseGameList(text) {
    const lines = text.split('\n').map(l => l.trim()).filter(l => l.length > 0);
    const games = [];
    for (const line of lines) {
      const parts = line.split(/,(.+)/);
      if (parts.length < 2) continue;
      let filename = parts[0].trim().replace(/^cl/, '');
      const url = parts[1].trim();
      games.push({ filename, url });
    }
    return games;
  }

  function getDriveDirectURL(url) {
    let idMatch = url.match(/\/d\/([a-zA-Z0-9_-]+)/);
    if (idMatch) return `https://drive.google.com/uc?export=download&id=${idMatch[1]}`;
    idMatch = url.match(/open\\?id=([a-zA-Z0-9_-]+)/);
    if (idMatch) return `https://drive.google.com/uc?export=download&id=${idMatch[1]}`;
    return null;
  }

  async function fetchHtmlViaProxy(url) {
    const proxyURL = 'https://corsproxy.io/?' + encodeURIComponent(url);
    const response = await fetch(proxyURL);
    if (!response.ok) throw new Error(`Fetch failed with status ${response.status}`);
    return response.text();
  }

  let allGames = [];
  let fuse;

  function renderButtons(games) {
    buttonsDiv.innerHTML = '';
    for (const { filename, url } of games) {
      const btn = document.createElement('button');
      btn.textContent = filename;
      btn.title = url;

      btn.onclick = async () => {
        try {
          statusDiv.textContent = `Loading ${filename}...`;
          const directURL = getDriveDirectURL(url);
          if (!directURL) throw new Error('Invalid Google Drive URL');
          const html = await fetchHtmlViaProxy(directURL);
          const newTab = window.open('about:blank');
          if (!newTab) {
            alert('Pop-up blocked. Please allow pop-ups for this site.');
            return;
          }
          newTab.document.open();
          newTab.document.write(html);
          newTab.document.close();
          statusDiv.textContent = `Loaded ${filename} in new tab.`;
        } catch (err) {
          alert('Error loading file: ' + err.message);
          statusDiv.textContent = 'Error: ' + err.message;
        }
      };

      buttonsDiv.appendChild(btn);
    }
  }

  (async () => {
    try {
      allGames = parseGameList(textData);
      fuse = new Fuse(allGames, {
        keys: ['filename'],
        threshold: 0.4
      });

      renderButtons(allGames);
      statusDiv.textContent = `Loaded ${allGames.length} games.`;

      searchInput.addEventListener('input', () => {
        const query = searchInput.value.trim();
        if (!query) {
          renderButtons(allGames);
          statusDiv.textContent = `Showing all ${allGames.length} games.`;
        } else {
          const result = fuse.search(query);
          const matches = result.map(r => r.item);
          renderButtons(matches);
          statusDiv.textContent = `Showing ${matches.length} result(s).`;
        }
      });
    } catch (e) {
      statusDiv.textContent = 'Error: ' + e.message;
    }
  })();
